import React from 'react'
import './App.css';
import Nav from './Nav';
import About from  './About';
import Shop from './Shop';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Nav />
        <About />
        <Shop />
      </Router>
    </div>
  );
}

export default App;
